    return (
        <>
    <h1>Word List Builder</h1>
    <div className="container">
        <WordDisplay/>
        <div className="word-buttons">
            <button>Remove</button>
            <button>Add</button>
            <button>Submit</button>
        </div>
        <SearchTag/>
    </div>
    </>
    )
}
